import logo from './logo.svg';
import './Main.css';
import './Responsive.css';
import './Overall.css';

function Main() {
  return (
    <div class="home">
        <div class="container">
            <div id="particles-js" class="particles"></div>
            <a href="index.php" class="home__logo">
                <img src='../images/logo.png' alt='image' class='imgFluid' loading='lazy' />
            </a>
            <div class="wrapper">
                <a href="../seller/sign-up.php" class="themeBtn themeBtn--full">Seller </a>
                <a href="../buyer/sign-up.php" class="themeBtn themeBtn--full themeBtn--secondary">Buyer</a>
            </div>
            <a href="javascript:void(0)" data-toggle="modal" data-target="#fingerPrint" class="finger-print">
                <img src='../images/finger-print-img.png' alt='image' class='imgFluid finger-print__img' loading='lazy' />
                <div class="finger-print__title">Use fingerprint instead?</div>
            </a>
        </div>
    </div>
  );
  function appendScripts(scriptName) {
      const script = document.createElement("script");
      script.src = scriptName;
      document.body.appendChild(script);
  }
  window.addEventListener("load", function() {
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/bootstrap.min.js");
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/particles.js");
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/particles.min.js");
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/slick.js");
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/app.js");
  }); 
}
export default Main;
